INSERT INTO `album` VALUES (1, '1569759981267', '身似秋水任飘渺', '身似秋水任飘渺', '1', '1', '1', 0, '小清新', '3', '4', '11', NULL, NULL, NULL, 15, '2', '甲子名人帖天下第一剑，还珠楼之主，凭借自创的“飘渺剑法”名震天下。以神蛊温皇的身份退隐江湖多年，在西剑流入侵中原之际再现踪迹。利用一人两化的双重身份之谜牵制西剑流，同时清理还珠楼反叛势力重掌大权。', NULL, '2019-09-01', '2019-09-29 20:26:21', 1, '2019-09-29 12:39:55', 1, 2, NULL, 1, NULL, NULL);
INSERT INTO `album` VALUES (2, '1569760104428', '名剑求瑕亦多愁', '名剑求瑕亦多愁', '1', '1', '1', 0, '名剑求瑕亦多愁', '3', '8', '9', NULL, NULL, NULL, 16, '2', '剑九·轮回：意为”八式往复入轮回“。御地气为己用，演八式谓轮回。', NULL, '2019-09-02', '2019-09-29 20:28:24', 1, '2019-09-29 20:28:24', 1, 1, NULL, 0, NULL, NULL);
INSERT INTO `album` VALUES (3, '1569760177906', '独向苍天开冷眼', '独向苍天开冷眼', '1', '1', '1', 0, '独向苍天开冷眼', '6', '8', '9', NULL, NULL, NULL, 17, '2', '剑十·天葬：意为”自生而灭为天葬”。运周天聚梵海，趋轮回入天葬。', NULL, '2019-09-03', '2019-09-29 20:29:38', 1, '2019-09-29 12:31:38', 1, 2, NULL, 1, NULL, NULL);
INSERT INTO `album` VALUES (4, '1569760283117', '笑问岁月几时休', '笑问岁月几时休', '1', '1', '1', 0, '笑问岁月几时休', '6', '12', '11', NULL, NULL, NULL, 18, '2', '意为\"极而复始，不生不灭\"。与宫本总司对战不悔峰时领悟的招式，险胜宫本总司。八式往复，不堕轮回。不生不灭，涅槃自现', NULL, '2019-09-04', '2019-09-29 20:31:23', 1, '2019-09-29 20:31:23', 1, 1, NULL, 0, NULL, NULL);
INSERT INTO `album` VALUES (5, '1569760397218', '烟柳画桥', '烟柳画桥', '1', '1', '1', 0, '烟柳画桥', '7', '12', '11', NULL, NULL, NULL, 19, '2', '年过百岁的剑界传奇，中原隐世家族天剑慕容府之主。七十年前携剑横渡巴川，遨游天下，访遍当时八百刀剑门，败尽玄枪十三坞，在其彻底成名之年，古岳峰尚未扬名，史艳文，藏镜人等皆未出世。', NULL, '2019-09-05', '2019-09-29 20:33:17', 1, '2019-09-29 20:33:17', 1, 1, NULL, 0, NULL, NULL);
INSERT INTO `album` VALUES (6, '1569760479743', '霓霞羽战火连天', '霓霞羽战火连天', '1', '1', '1', 0, '霓霞羽战火连天', '5', '4', '11', NULL, NULL, NULL, 20, '2', '长年待在血色琉璃树阵法之中，静静擦拭手中铜镜的奇人。外表冷漠孤寂，初登场便以三句问话，指点迷惘的俏如来。后收俏如来为传人，此先曾有一徒雁王。其真实身分为巡视九界的墨家钜子，潜于历史幕后，甚少出现在台面上，不主张墨家现于阳光之下，在九界各处皆有不同化名。无人知其真名，默苍离亦为化名之一。', NULL, '2019-09-06', '2019-09-29 20:34:40', 1, '2019-09-29 12:40:38', 1, 2, NULL, 0, NULL, NULL);
INSERT INTO `album` VALUES (7, '1569760537125', '墨影神誓护千年', '墨影神誓护千年', '1', '1', '1', 0, '墨影神誓护千年', '3', '8', '11', NULL, NULL, NULL, 21, '2', '化名神奕子参加苗疆金碑开局，与苗疆第一棋手北竞王对弈。北竞王先手落子，和棋收场。用名默苍离时期再见小王，自称是自己不想赢，不然再让三子亦可败北竞王到无地自容。', NULL, '2019-09-07', '2019-09-29 20:35:37', 1, '2019-09-29 20:35:37', 1, 1, NULL, 1, NULL, NULL);
INSERT INTO `album` VALUES (8, '1569760593153', '寄语孤鸿诛邪灭', '寄语孤鸿诛邪灭', '1', '1', '1', 0, '寄语孤鸿诛邪灭', '3', '8', '9', NULL, NULL, NULL, 21, '2', '', NULL, '2019-09-08', '2019-09-29 20:36:33', 1, '2019-09-29 20:36:33', 1, 1, NULL, 1, NULL, NULL);
