INSERT INTO `album` VALUES (10, '1569760715272', '芳菲阑珊', '芳菲阑珊', '1', '1', '1', 0, '芳菲阑珊', '5', '12', '11', NULL, NULL, NULL, 23, '2', '出身道域仙舞剑宗，执剑师岳万丘之义子，其父乃当时道域执权者玉千城，「风花雪月」中的「月」。多年前道域因修真院惨案而陷入内战，遂与风中捉刀等人离开家乡，却在水月同天遭小碎刀步杀成重伤，後为冥医所救，於通幽谷再出之时，已是疯癫状态，与娇姨相依为命，血不染亦由娇姨保管。其後在因缘际会下，与修儒结识，重揭过往。', NULL, '2019-09-10', '2019-09-29 20:38:35', 1, '2019-09-29 12:40:23', 1, 3, NULL, 1, NULL, NULL);
INSERT INTO `album` VALUES (11, '1569760788535', '夙缘鶗鴃', '夙缘鶗鴃', '1', '1', '1', 0, '夙缘鶗鴃', '5', '8', '11', NULL, NULL, NULL, 24, '2', '本属于最美丽的谜题，何必追寻呢？', NULL, '2019-09-11', '2019-09-29 20:39:49', 1, '2019-09-29 20:39:49', 1, 1, NULL, 1, NULL, NULL);
