INSERT INTO `album` VALUES (19, '1569761350692', '八面玲珑', '八面玲珑', '1', '1', '1', 0, '八面玲珑', '5', '8', '9', NULL, NULL, NULL, 31, '2', '出自道域紫微星宗，风花雪月之「雪」，仪态如大家闺秀，精擅掌法，现身後受俏如来请托，解开方独白所中的咒命七罡字。在道域纠葛中，扮演无辜者的形象，实则心机深沉，为真正与忘今焉串谋的幕後黑手，在荻花题叶身亡之後，於月凝湾暗掌重伤无情葬月，卸下多年来的伪装。', NULL, '2019-09-17', '2019-09-29 20:49:11', 1, '2019-09-29 20:49:11', 1, 1, NULL, 0, NULL, NULL);
