INSERT INTO `album` VALUES (22, '1569761583208', '五行定位·大地之罚', '五行定位·大地之罚', '4', '1', '1', 0, '五行定位·大地之罚', '6', '8', '9', NULL, NULL, NULL, 35, '2', '出自道域阴阳学宗，文生气息的英俊小生，个性诙谐，却相当拘於小节，「风花雪月」中的【花】，看似风流倜傥，实则锺情於玲珑雪霏。术法属顶尖之流，本身习有「怒天之惩」与高段咒术「咒命七罡字」，因禹晔绶真带回血不染再现的消息，遂开始关注无情葬月的行踪。', NULL, '2019-09-20', '2019-09-29 20:53:03', 1, '2019-09-29 13:01:35', 1, 2, NULL, 0, NULL, NULL);
INSERT INTO `album` VALUES (23, '1569761625855', '芦荻飞花秋带杀', '芦荻飞花秋带杀', '4', '1', '1', 0, '芦荻飞花秋带杀', '5', '8', '9', NULL, NULL, NULL, 36, '2', '', NULL, '2019-09-21', '2019-09-29 20:53:46', 1, '2019-09-29 20:53:46', 1, 1, NULL, 1, NULL, NULL);
INSERT INTO `album` VALUES (24, '1569761757698', '梦琐琼楼枕无忧', '梦琐琼楼枕无忧', '1', '1', '1', 0, '梦琐琼楼枕无忧', '6', '12', '9', NULL, NULL, NULL, 37, '2', '修罗国度策君，沉沦海首智。常年为修罗国度镇守沉沦海，维持三方势力和平，计谋不凡。看似幽默搞怪，实则奇谋诡谲，杀伐果断，喜怒无常。公子开明身份多变，既是修罗国度策君，又是释墨传人迦谛圣者，便如同传说中的开明兽一般，九首九思，变化万千，难现真颜。', NULL, '2019-09-22', '2019-09-29 20:55:58', 1, '2019-09-29 12:56:19', 1, 2, NULL, 1, NULL, NULL);
