INSERT INTO `category_info` VALUES (2, NULL, '请假流程', 0, 10, 1, 10, '请假流程', '2019-11-13 14:23:20.385000', 4, '2019-11-13 14:23:21', 4, NULL, '0', 0, NULL, 1);
INSERT INTO `company_setting` VALUES (1, '青橙摄影工作室', 'http://127.0.0.1:18080/images/1001/61/2019/10/25/21a5bf0fb5844380ba27e579f49fabfd.png', '成都市成华区建设路1号万科金域蓝湾(SM广场对面)18栋2903室', '周一至周日9:00-18:00', '阿波', '13408497745', '&nbsp;真五洲掌中剧团（原为五洲园三团）组于1951年，由黄俊雄先生带领，从外台戏演到内台戏时期，戏码主要以传统北管戏曲为主。成团几年后，黄俊雄先生有感掌中木偶无法让远处的观众清楚欣赏到木偶身段，便将木偶尺寸稍为改革加大。「真五洲」更在黄俊雄的带领下开始跨越传统艺术的领域，不但拍摄电影更将西洋乐曲融入戏剧中，将木偶改为三尺三的大型戏偶。更将布袋戏搬到电视萤光幕前，创下史无前例的97%收视率的辉煌纪录。<br>1984年以《霹雳城》再开电视布袋戏史的另一个奇迹，并转有其次子黄文择主演。此后几位儿子先后发展出由黄强华、黄文择所带领的霹雳布袋戏（霹雳国际多媒体）、黄文耀的天宇布袋戏（大天宇）以及黄立纲的金光布袋戏（金光/天地多媒体）。其中，金光布袋戏承接史艳文传奇，开创现今人称「金光系列」的布袋戏影视剧集。<br>2006年起，黄俊雄大师幺子黄立纲传承衣钵，担起史艳文系列布袋戏第三代传人的使命，成为天地多媒体、金光剧组责任人，与其胞姊黄凤仪一同打造新一代「金光布袋戏」。人称「黄大侠」的黄立纲，多年来接受父亲的培训，随父到各地表演、制作剧集作品', 'http://127.0.0.1:18080/images/1001/62/2019/10/25/580564784b324325a27faba523087ff2.png', 'http://127.0.0.1:18080/images/1001/61/2019/10/25/ff81d1aa06bd4148b997e86dec5a58ce.png', NULL, NULL, '川ICP备16040102号-1', '2019-10-25 10:07:13', 4, '2019-11-06 15:17:15', 4, NULL, NULL);
INSERT INTO `new_activities` VALUES (2, '1570413209024', '雁翼回翔', '2019-10-08', '2019-10-13', 0, 500.00, 200.00, 4.00, '上官鸿信', '18587584425', NULL, '&nbsp;羽国特产，只有羽国人能操纵，据雁王所说，能同时操纵三颗断云石便是绝顶高手。<br><br>断云石第一具备吸收功力转化的能力，既能吸收使用者的功力，瞬间爆发，也能吸纳攻击气劲;第二可以判断使用者感应的内力;第三能够预先作为埋伏，根据真气追踪攻击敌人', 0, 'http://127.0.0.1:18080/images/1001/51/2019/10/7/2e94c049edd7428689e39db60ab85c9c.jpg', NULL, '2019-10-07 09:53:29', 1, '2019-10-07 09:53:29', 1, 1, 20, NULL, 621, NULL);
INSERT INTO `new_activities` VALUES (3, '1570413352120', '黑夜穿梭幽灵影', '2019-10-14', '2019-10-20', 0, 1200.00, 960.00, 8.00, '南宫恨', '18587488562', NULL, '&nbsp;刺激，刺激啦!<br><br>不能抗天，何称不败!<br><br>谁，杀得了黑白郎君。<br><br>吾之性命，唯有胜利，失败的注定是你!', 0, 'http://127.0.0.1:18080/images/1001/51/2019/10/7/347f32773b7f42c380b0d5295f1a5ee7.jpg', NULL, '2019-10-07 09:55:52', 1, '2019-10-07 09:55:52', 1, 1, 5, NULL, 631, NULL);
INSERT INTO `new_activities` VALUES (4, '1570413526675', '白色骷髅形似马', '2019-10-21', '2019-10-27', 0, 1500.00, 1350.00, 9.00, '黑白郞君', '18587488524', NULL, '&nbsp;你们，齐上吧。<br><br>黑白郎君不屑与小辈争斗。<br><br>黑白郎君不杀不会武功的人。<br><br>这逼命的气氛，这搏杀的快感，痛快…痛快!这一战，值得。', 0, 'http://127.0.0.1:18080/images/1001/51/2019/10/7/f76e637acad3465a98ef6d7d98ccc76d.jpg', NULL, '2019-10-07 09:58:47', 1, '2019-10-07 09:58:47', 1, 1, 7, NULL, 644, NULL);
INSERT INTO `new_activities` VALUES (5, '1570413672809', '郎唤南宫名带恨', '2019-10-28', '2019-11-03', 0, 800.00, 720.00, 9.00, '中原第一人', '18547411254', NULL, '&nbsp;中原第一狂人，狂傲不羁，藐视群雄，素以挑战各方高手为嗜好，更以对方的失败为快乐。当初在史艳文决战藏镜人时闯入，从此下落不明。实则因西剑流祭司禁术之故，而分化成黑龙、白狼善恶两体。而今，能击破魔之甲的他，何时才能回归、未来动向如何，都将是决定中原与西剑流之战胜负的关键……--(决战时刻:英雄扉页)', 0, 'http://127.0.0.1:18080/images/1001/51/2019/10/7/f64123afc64c4946b474bbae2c82d13e.jpg', NULL, '2019-10-07 10:01:13', 1, '2019-10-07 10:01:13', 1, 1, 22, NULL, 654, NULL);
INSERT INTO `new_activities` VALUES (6, '1570413799816', '君扬怒眉杀天下', '2019-11-04', '2020-10-11', 0, 1500.00, 1200.00, 8.00, '上衫龙矢', '18258744512', NULL, '&nbsp;想在黑白郎君前面杀人，吾允准了吗。<br><br>黑白郎君，永不言败。<br><br>一气化九百破解不了，但黑白郎君可以。<br><br>南宫恨所败之人何时轮到你讥讽。', 0, 'http://127.0.0.1:18080/images/1001/51/2019/10/7/0f1d24bcd8064dc5a7fa1d3a011c153b.jpg', NULL, '2019-10-07 10:03:20', 1, '2019-10-07 10:03:20', 1, 1, 8, NULL, 663, NULL);
INSERT INTO `new_activities` VALUES (7, '1570413951290', '怒马凌关', '2019-11-11', '2019-11-17', 0, 2000.00, 1000.00, 5.00, '一气化九百', '18285744025', NULL, '&nbsp;本名南宫恨，武林狂人，以五绝神功独步天下，喜爱四处挑战天下高手，并以得胜为乐，且号称天下第一狂，当年闯入史艳文与藏镜人战局，之后一分为二，化为黑龙与白狼，后又合体，也因如此与忆无心之间有种难以言语的情感。--(金光群侠传:黑白郎君)<br><br>在一次苗疆围剿中，黑白郎君被拖进网中人的魔茧中，其后忆无心被魔兵追杀，看到被网中人藏起的魔茧，在忆无心的协助之下，黑白郎君顺利破茧而出', 0, 'http://127.0.0.1:18080/images/1001/51/2019/10/7/12f670b1eb304ca5a8f6555d2c7e7b42.jpg', NULL, '2019-10-07 10:05:51', 1, '2019-10-07 10:05:51', 1, 1, 3, NULL, 673, NULL);
INSERT INTO `new_activities` VALUES (8, '1570414091776', '离合并流', '2019-11-01', '2019-12-07', 0, 1600.00, 1440.00, 9.00, '一气化三千', '18587422623', NULL, '&nbsp;击破魔之甲的唯一人选，中原武林竭力让他出现，多次于「短暂回复」状态下战斗，最终随着黑龙、白狼合体而永久恢复。--(史艳文传奇:变·黑白郎君)<br><br>危急之刻黑龙、白狼为救忆无心，放弃自身意识合体后再现武林，与毕生仇敌网中人有着无穷无尽、纠缠不断的恩怨情仇。--(史艳文传奇:异·黑白郎君)', 0, 'http://127.0.0.1:18080/images/1001/51/2019/10/7/a3b80d5c099344608f5c20f04e7316da.jpg', NULL, '2019-10-07 10:08:12', 1, '2019-10-07 10:08:12', 1, 1, 5, NULL, 683, NULL);
INSERT INTO `new_activities` VALUES (9, '1570414240882', '阴阳之气藉脉导引', '2019-11-17', '2019-11-24', 0, 1700.00, 1360.00, 8.00, '忆无心', '1852874452', NULL, '&nbsp;肤色雪白，一身纯白色皮毛与庞克头是其特征，性格桀骜不驯、好战、利己，但心性不坏，可能是分化后的黑白郎君灵体。--(决战金光:史艳文传奇)<br><br>黑白郎君分化，一心想要恢复成黑白郎君而不断的找上黑龙，有着黑白郎君猖狂的性格，企图以武力来逼迫黑龙就范。--(决战时刻:甲子名人帖)', 0, 'http://127.0.0.1:18080/images/1001/51/2019/10/7/fae99944eeb24d4b82d95ba9279bb934.jpg', NULL, '2019-10-07 10:10:41', 1, '2019-10-07 10:10:41', 1, 1, 7, NULL, 693, NULL);
INSERT INTO `new_activities` VALUES (10, '1570414469301', '月轮慈照', '2019-11-10', '2019-11-17', 0, 1200.00, 1080.00, 9.00, '水石变', '18258745631', NULL, '&nbsp;藏镜人与女暴君之女。被女暴君抛弃而后流转灵界。因真实身份而被卷入武林风波，有操控石头之异能。--(金光风云录)<br><br>藏镜人与女暴君之女，被遗弃交趾边界的石头堆中，由叹悲欢(灵界三师弟)捡回抚养，拥有与石头沟通的能力，天性十分善良，思想早熟。与黑龙和白狼之间有着特殊的情谊。--(九龙变:宣传简介)', 0, 'http://127.0.0.1:18080/images/1001/51/2019/10/7/58b548647d654a3ead928077d8376fa6.jpg', NULL, '2019-10-07 10:14:29', 1, '2019-11-13 05:59:19', 1, 3, 10, NULL, 703, NULL);
