INSERT INTO `staff_details_info` VALUES (3, '001', 4, '默苍离', '孤鸿寄语', 0, '18280300427', '2018-08-01', 1, 1, 510000, 510100, 510104, '华联东路18号', '18280300427', '18280300427@163.com', '532258874', '18280300427', 'https://weibo.com/', '2000-08-26', NULL, '万军无兵策天凤（在羽国所用化名，见载于《羽国志异》，为本书主人公）神奕子（在苗疆所用化名，参与北竞王金碑开局）黓龙君（在道域所用化名，阴阳学宗当世七雅之一\"云棋水镜\"，参与道域之乱）盗才生（在送给俏如来的《羽国志异》上所署化名）', '0,1', '霓霞羽战火连天，墨影神誓护千年。寄语孤鸿诛邪灭，止戈剑印荡魔渊', '513436200008267656', 0, '2019-08-29 16:21:58', 1, '2019-08-30 10:37:15', 1, 1, NULL, NULL, '2', NULL, NULL, NULL, NULL, NULL, 0);
INSERT INTO `staff_details_info` VALUES (4, '002', 5, '任飘渺', '神蛊温皇', 0, '18280300421', '2019-03-01', 1, 2, 510000, 510100, 510114, '国宁东路', '18280300421', '18280300421@163.com', '512501197', '18280300421', '', '1972-03-03', NULL, '剑一·破、剑二·空、剑三·飞、剑四·灭、剑五·虚、剑六·绝、剑七·真、剑八·玄。', '0,1', '风满楼，卷黄沙，舞剑春秋，名震天下。雨飘渺，倦红尘，还君明珠，秋水浮萍。', '512501197203035172', 0, '2019-08-30 16:08:39', 1, '2019-08-30 16:08:39', 1, 1, NULL, NULL, '2', NULL, NULL, NULL, NULL, NULL, 0);
INSERT INTO `staff_details_info` VALUES (5, '003', 6, '公子开明', '策君', 0, '18280300422', '2017-08-02', 1, 1, 510000, 510100, 510114, '富海小区', '18280300422', '18280300422@163.com', '210802199', '18280300422', '', '1991-10-09', NULL, '愿此佛声渡尘界，三千娑婆悉皆闻。', '1,3', '梦琐琼楼枕无忧，千古流芳别寒秋。夕照云舟恨归晚，几度争锋几度休', '210802199110090032', 0, '2019-08-30 16:21:40', 1, '2019-08-30 16:21:40', 1, 1, NULL, NULL, '2', NULL, NULL, NULL, NULL, NULL, 0);
INSERT INTO `staff_details_info` VALUES (6, '004', 7, '南宫恨', '黑白郞君', 1, '18280300423', '2019-06-03', 1, 1, 510000, 510100, 510104, '', '18280300423', '18280300423@163.com', '2102031975', '18280300423', '', '1975-03-10', NULL, '兵器：幽灵魔刀（元邪皇王骨，已断）、阴阳扇<br>物品：狼王爪（分身寄体，后被女暴君取走）、阴阳泪石（赠予忆无心）<br>坐骑：幽灵马车<br>其它：魔之甲（跟真假魔之甲的不同主人打过三次）', '0,1', '黑夜穿梭幽灵影，白色骷髅形似马，郎唤南宫名带恨，君扬怒眉杀天下。', '210203197503102721', 0, '2019-08-31 11:49:01', 1, '2019-08-31 11:59:02', 1, 0, NULL, NULL, '2', NULL, NULL, NULL, NULL, NULL, 0);
INSERT INTO `staff_details_info` VALUES (7, '005', 8, '罗碧', '藏镜人', 1, '18280300424', '2019-07-24', 1, 1, 510000, 510100, 510181, '青城山', '18280300424', '18280300424@163.com', '1301021963', '18280300424', '', '1963-03-25', NULL, '化身：天地不容客（自地门蜕变再出）<br>假扮：史艳文（与史艳文交换身份领导中原群侠）<br>归属：苗疆<br>家族：云州史家<br>组织：苗疆朝堂（已脱离）、地门（已脱离）<br>口头禅：不应该啊——<br>武器：墨邪<br>宝物：藏身宝镜', '0,1', '回忆迷惘杀戮多，往事情仇待如何&nbsp;。绢写黒诗无限恨，夙兴夜寐枉徒劳', '130102196303250459', 0, '2019-08-31 12:02:21', 1, '2019-09-29 19:05:55', 1, 1, 'http://127.0.0.1:18080/images/1001/100/2019/9/29/5e55e58ccf9341599b27d4a2e615535d.jpg', 3, '2', NULL, NULL, NULL, NULL, NULL, 0);
INSERT INTO `staff_details_info` VALUES (8, '006', 9, '竞日孤鸣', '北竞王', 1, '18280300245', '2019-08-01', 1, 2, 510000, 510100, 510114, '植物园', '18280300245', '18280300245@163.com', '511502199103', '18280300245', '', '1991-03-22', NULL, '北龙归去没苍穹，长眠银川卧星河。<br>华门月宫悲愁影，尽写一夜长恨歌。', '0,1', '炊烟尽处有人家，一亩耕勤到日斜。<br>薄米犹同星入碗，桑居亦可号琅琊。', '511502199103223189', 0, '2019-08-31 12:05:50', 1, '2019-09-29 19:03:42', 1, 1, 'http://127.0.0.1:18080/images/1001/100/2019/9/29/5850c1c306894c49afe1189c1c6c6743.jpg', 1, '2', NULL, NULL, NULL, NULL, NULL, 0);
INSERT INTO `staff_details_info` VALUES (9, '007', 10, '赤羽信之介', '西剑流军师', 1, '18280300426', '2019-06-30', 1, 3, 510000, 510100, 510184, '街子古镇', '18280300426', '18280300426@163.com', '13082119910', '18280300426', '', '1991-03-27', NULL, '身份：西剑流军师、西剑流四天王之一<br>俳句：朱凰降中土，赤羽惊鸿舞春秋，情义泯恩仇。<br>归属：东瀛<br>组织：西剑流<br>根据地：西剑流中原分部、西剑流东瀛总部<br>决策地：神唤大殿', '2,3', '为西剑流军师，武功亦属西剑流四大天王之一，火属性的溘钨鐁威力强大，心思细腻，思维缜密，容貌威严俊美，协助祭司侵略中原，与以中原为主的各方势力展开争斗，行事风格上，果断而不失情理，使同侪与部下皆对他心服。其后受俏如来之恩，使西剑流免於在炎魔幻十郎手中全军覆没。赤羽因此感念在心，因此在收到了欲星移伪造的神蛊温皇信件，得知魔世之乱后，协神田京一再返中原，有恩报恩，有仇报仇。', '130821199103278829', 0, '2019-08-31 12:07:59', 1, '2019-09-29 19:06:51', 1, 1, 'http://127.0.0.1:18080/images/1001/100/2019/9/29/c237022c03524766b01328eee76c8419.jpg', 4, '2', NULL, NULL, NULL, NULL, NULL, 0);
INSERT INTO `staff_details_info` VALUES (10, '008', 11, '飞凕', '无情葬月', 1, '18280300428', '2018-08-27', 1, 3, 510000, 510100, 510104, '道域', '18280300428', '18280300427@163.com', '52032319780', '18280300427', '', '1978-06-05', NULL, '宗主：玉千城<br>辅师：琅函天（忘今焉）<br>持剑师：岳万丘<br>成员：敖鹰、靖灵君、无情葬月', '0,1', '芳菲阑珊，夙缘鶗鴃，风驷云轩愁誓约。夜蝶飞阶，霎微雨阙，剑锋无情人葬月', '520323197806058856', 0, '2019-08-31 12:10:22', 1, '2019-08-31 12:10:22', 1, 1, NULL, NULL, '2', NULL, NULL, NULL, NULL, NULL, 0);
INSERT INTO `staff_details_info` VALUES (11, '009', 12, '莫离骚', '天之道', 1, '18280300249', '2019-04-08', 1, 3, 510000, 510100, 510106, '金牛宾馆', '18280300249', '18280300249@163.com', '350105199', '18280300249', '', '1995-06-13', NULL, '归属：道域、中原<br>组织：仙舞剑宗、天剑慕容府<br>初登场：金光御九界之齐神箓第26集<br>武器：持之不败<br>武学：行令剑围', '2', '玉笔难图，千篇离骚，入世不踏沧桑路，出尘不落槁朽苏。别离书卷，人海泛渡；闲时舞剑点飞霜，谁人疏狂？自在如吾，一诗一剑定风波。', '350105199506138487', 0, '2019-08-31 13:03:24', 1, '2019-08-31 13:03:24', 1, 1, NULL, NULL, '2', NULL, NULL, NULL, NULL, NULL, 0);
INSERT INTO `staff_details_info` VALUES (12, '010', 13, '西江横棹', '西风横笑', 0, '18280300229', '2019-07-30', 1, 2, 510000, 510100, 510131, '肾小道宗', '18280300229', '18280300229@163.com', '15222419890', '18280300229', '', '1989-08-02', NULL, '上司：枫零公子（称之为『铁公子』）<br>下属：病养生、涂万里、翱大宗', '1', '西风横笑历经惨败后，改名西江横棹，终生不再用刀。遂持一口木浆为用，行江捕鱼为生。但西江横棹对昔年一战耿耿于怀，日夜运棹为刀。一口普通船桨，挥如大刀阔斧、雄武生风。<br>于道源迷津再战天之道，此浆不堪持之不败之锐，屡屡斫断。最终西风横笑了却一生夙愿，为不让自己的兀者身份连累刀宗，用残浆断柄自尽，了却蹉跎今生。', '152224198908049211', 0, '2019-08-31 13:05:29', 1, '2019-09-29 19:04:59', 1, 1, 'http://127.0.0.1:18080/images/1001/100/2019/9/29/f4edb65a03504e0fac98157b44962dc5.jpg', 2, '2', NULL, NULL, NULL, NULL, NULL, 0);
