  `staff_sex` tinyint(4) NULL DEFAULT 0 COMMENT '性别 0:男  1:女',
  `mobile_phone` char(11) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '绑定的手机号',
  `entry_date` date NULL DEFAULT NULL COMMENT '入职日期',
  `staff_category` tinyint(4) NULL DEFAULT NULL COMMENT '员工类别   0：超级管理员 1：普通管理员  2：员工  ',
  `staff_position` tinyint(4) NULL DEFAULT NULL COMMENT '员工职务   1: 摄影师 2：数码师（后期）  3：化妆师 等',
  `province` bigint(20) NULL DEFAULT NULL COMMENT '所在省份',
  `city` bigint(20) NULL DEFAULT NULL COMMENT '所在城市',
  `district` bigint(20) NULL DEFAULT NULL COMMENT '所在行政区',
  `street` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '所在行政区街道',
  `staff_phone` char(11) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '员工联系电话',
  `staff_email` varchar(60) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '电子邮箱',
  `staff_qq` varchar(15) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '联系QQ号',
  `staff_wechat` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '联系微信号',
  `staff_wei_bo` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '微博',
  `birthday` date NULL DEFAULT NULL COMMENT '生日',
  `staff_age` tinyint(4) NULL DEFAULT NULL COMMENT '年龄',
  `staff_equipment` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '器材装备',
  `skill` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '技能 多个用;隔开',
  `staff_intro` varchar(400) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '个人介绍',
  `staff_identiy_card` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '员工身份证',
  `staff_status` tinyint(4) NOT NULL DEFAULT 0 COMMENT '状态：0：正常  1：冻结  2：离职',
  `create_time` timestamp(0) NOT NULL COMMENT '创建时间',
  `create_user_id` bigint(20) NOT NULL COMMENT '创建人ID',
  `update_time` timestamp(0) NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP(0) COMMENT '最后修改时间',
  `update_user_id` bigint(20) NULL DEFAULT NULL COMMENT '最后修改人ID',
  `data_version` bigint(20) NULL DEFAULT 1 COMMENT '版本号',
  `staff_portrait` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '头像',
  `staff_portrait_id` bigint(20) NULL DEFAULT NULL COMMENT '头像ID',
  `probation_status` varchar(10) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '试用期状态',
  `lessee` bigint(20) NULL DEFAULT NULL COMMENT '租户ID',
  `working_age` int(11) NULL DEFAULT NULL COMMENT '在职年限 (月)',
  `working_years` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '在职年限 年月日 格式',
  `dimission_date` date NULL DEFAULT NULL COMMENT '离职日期',
  `dimission_reason` varchar(10) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '离职原因',
  `display` tinyint(4) NULL DEFAULT 0 COMMENT '是否在网页展示 0：展示  1：不展示',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 16 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '员工详细信息表' ROW_FORMAT = Dynamic;

